 // SPDX-License-Identifier: MIT

pragma solidity ^0.8.14;
import "./MyToken.sol";
contract Distribut {
      uint256 public total;
      uint256 public tokenSalePercentage;
      uint256 public tokenFoundersPercentage;
      uint256 public tokenTeammemberPercentage;

     mapping(uint256 => Saler) private _salers;
     mapping(uint256 => Founder) private _founders;
     mapping(uint256 => Teammember) private _teammember;

 // Token Distribution


 //ids
     uint256 private _tokenSalerId=0;
     uint256 private _tokenFounderId=0;
     uint256 private _tokenTeammemberId=0;
    constructor(){
        total = new MyToken().TokenMint();
        tokenSalePercentage =total/2;
        tokenFoundersPercentage = total/5;
        tokenTeammemberPercentage=total/4;
    }

     enum Status {
          Active,
          Sold,
          Cancelled
   }

struct Saler {

        address saler;
        address token;
        uint256 tokenId;
        uint256 price;

}

struct Founder {

        Status  tokenstatus;
        address founder;
        address token;
        uint256 tokenId;
        uint256 price;
        uint256 UseTime;

}

struct Teammember {
        Status  tokenstatus;
        address teamlead;
        address token;
        uint256 tokenId;
        uint256 price;
        uint256 UseTime;

}

    function getFoundersTotalSupply() public view returns(uint256) {
        return tokenFoundersPercentage;
    }
    //  function to add new Seller
    function addSeller(address token, uint256 tokenId, uint256 price) external {
        Saler memory salers = Saler(
            msg.sender,
            token,
            tokenId,
            price
        );

        ++_tokenSalerId;
        _salers[_tokenSalerId] = salers;
    }


    // function to add new Founder
    function addFounder(address founder, address token, uint256 tokenId,uint256 price) external {
        Founder memory founders = Founder(
            Status.Active,
            founder,
            token,
            tokenId,
            price,
            (block.timestamp + 300 days)
        );

        ++_tokenFounderId;
        _founders[_tokenFounderId] = founders;
    }


    // function to add teammember
    function addTeamlead(address teamlead, address token, uint256 tokenId,uint256 price) external {
        Teammember memory teammember = Teammember(
            Status.Active,
            teamlead,
            token,
            tokenId,
            price,
            (block.timestamp + 200 days)
        );

        ++_tokenTeammemberId;
        _teammember[_tokenTeammemberId] = teammember;
    }

    function buyToken(uint256 sellerId) external payable {
        Saler storage salers = _salers[sellerId];

        require(msg.sender != salers.saler, "Buyer can not be a seller");
        require(msg.value >= salers.price, "Insufficient Balance");
        require(salers.tokenId < tokenSalePercentage, "There is no tokens");
        IERC20(salers.token).transferFrom(salers.saler, msg.sender, salers.tokenId);
        payable(salers.saler).transfer(salers.price);
        payable(msg.sender).transfer(msg.value - salers.price);
        tokenSalePercentage -= salers.tokenId;
    }
    //buying from founder
     function buyTokenFounder(uint256 founderId) external payable {
        Founder storage founders = _founders[founderId];
        require(tokenFoundersPercentage > 2 ,"founder  cant sale last token");
        founders.tokenstatus = Status.Cancelled;
        require(msg.sender != founders.founder, "Buyer can not be a seller");
         require(msg.value >= founders.price, "Insufficient Balance");
        require(founders.UseTime-block.timestamp >= 200,"founder can`t sale tokens ");
        IERC20(founders.token).transferFrom(address(this), msg.sender, founders.tokenId);
		payable(founders.founder).transfer(founders.price);
        tokenFoundersPercentage -= founders.tokenId;

    }

     //buying from  teamlead

}
